import React, { createContext, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Login';
import Singup from './Singup';
import Payement from './Payement';
import ForgotPassword from "./ForgotPassword";
import Matches from "./Matches";
import Category from "./Category";
import Guest from './Guest';
import Reset from './Reset';
import WelcomeScreen from './WelcomeScreen';
import Success from './Success';
import TicketQuantityPage from './TicketQuantityPage';
import ConfirmationPage from './ConfirmationPage';
import  DoorsPage from './DoorsPage';
import AuthGuard from './Authguard';
import Layout from './Layout';
export const RecoveryContext = createContext();

function App() {

  const [qrCode, setQrCode] = useState(null);

  return (

    <Router>
      <Routes>
        <Route path='/' element={<Layout><Login /></Layout>} />
        <Route path='/singup' element={<Layout><Singup /></Layout>} />
        <Route path='/payement' element={            <AuthGuard><Layout> <Payement setQrCode={setQrCode}/></Layout></AuthGuard>} />
        <Route path='/ForgotPassword' element={ <Layout><ForgotPassword /></Layout>} />
        <Route path='/Matches' element={<AuthGuard><Layout> <Matches /></Layout></AuthGuard> } />
        <Route path='/Category' element={<AuthGuard> <Layout><Category /> </Layout></AuthGuard>} />
        <Route path='/Guest' element={<AuthGuard><Layout> <Guest /></Layout></AuthGuard>} />
        <Route path='/Reset' element={<AuthGuard><Layout> <Reset /></Layout></AuthGuard>} />
        <Route path='/WelcomeScreen' element={<AuthGuard><Layout><WelcomeScreen /></Layout></AuthGuard>} />
        <Route path='/TicketQuantityPage' element={<AuthGuard> <Layout><TicketQuantityPage /></Layout></AuthGuard>} />
        <Route path='/WorldCupTicket' element={<AuthGuard><Layout> <ConfirmationPage /></Layout></AuthGuard>} />
        <Route path="/success" element={<AuthGuard><Layout> <Success qrCode={qrCode} /></Layout></AuthGuard>} />
        <Route path="/DoorsPage" element={<Layout>< DoorsPage /></Layout>} />

      </Routes>
    </Router>

  );
}

export default App;
